   "source": [
    "# Plot cumulative reward as a function of time.\n",
    "stats <- ddply(results,\n",
    "               c(\"Temperature\", \"T\"),\n",
    "               function (df) {mean(df$CumulativeReward)})\n",
    "ggplot(stats, aes(x = T, y = V1, group = Temperature, color = Temperature)) +\n",
    "  geom_line() +\n",
